import React, { useState } from "react";

// TabbedComponent
const TabbedComponent = ({ activeTab, setActiveTab }) => {
  const tabs = ["ERP", "TrackWise", "Summary", "Complete"];

  return (
    <div className="tab-bar">
      {tabs.map((tab) => (
        <button
          key={tab}
          onClick={() => setActiveTab(tab)}
          className={activeTab === tab ? "active" : ""}
        >
          {tab}
        </button>
      ))}
    </div>
  );
};

// ProgressBar
const ProgressBar = ({ activeTab }) => {
  const tabIndex = ["ERP", "TrackWise", "Summary", "Complete"].indexOf(
    activeTab
  );
  const progress = ((tabIndex + 1) / 4) * 100;

  return (
    <div className="progress-bar">
      <div className="progress" style={{ width: `${progress}%` }}></div>
    </div>
  );
};

// Form
const MainForm = () => {
  const [key, setKey] = useState("ERP");
  const [progress, setProgress] = useState(25); // Adjust the progress as needed

  // You would handle form field updates with onChange handlers here
  // ...

  // You would implement the form submission logic here
  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle the form submission
  };

  // Adjust the progress based on the key (active tab)
  const handleSelect = (k) => {
    setKey(k);
    const steps = ["ERP", "TrackWise", "Summary", "Complete"];
    const index = steps.indexOf(k);
    setProgress((index + 1) * (100 / steps.length));
  };

  return (
    <div>
      <Tabs activeKey={key} onSelect={handleSelect} className="mb-3">
        <Tab eventKey="ERP" title="ERP">
          {/* Form content for ERP */}
        </Tab>
        <Tab eventKey="TrackWise" title="TrackWise">
          {/* Form content for TrackWise */}
        </Tab>
        <Tab eventKey="Summary" title="Summary">
          {/* Form content for Summary */}
        </Tab>
        <Tab eventKey="Complete" title="Complete">
          {/* Form content for Complete */}
        </Tab>
      </Tabs>

      <ProgressBar now={progress} label={`${progress}%`} />

      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="reviewPeriod">
          <Form.Label>Review Period</Form.Label>
          <div key="inline-datepicker" className="mb-3">
            <Form.Control type="date" placeholder="Start Date" />
            <Form.Control type="date" placeholder="End Date" />
          </div>
        </Form.Group>

        <Form.Group controlId="plantSelect">
          <Form.Label>Plant</Form.Label>
          <Form.Control as="select" defaultValue="Choose...">
            {/* Populate with options */}
            <option>Choose...</option>
          </Form.Control>
        </Form.Group>

        <Form.Group controlId="globalBrandSelect">
          <Form.Label>Global Brand</Form.Label>
          <Form.Control as="select" defaultValue="Choose...">
            {/* Populate with options */}
            <option>Choose...</option>
          </Form.Control>
        </Form.Group>

        <div className="pt-3">
          <Button variant="secondary" type="button">
            Back
          </Button>
          <Button variant="primary" type="submit" className="mx-2">
            Next
          </Button>
          <Button variant="warning" type="reset">
            Reset
          </Button>
        </div>
      </Form>
    </div>
  );
};

export default ReportGenerateForm;
